text_show:
El Pardo shartnomasi — 1778-yil 11-martda, Ispaniya qirollik qarorgohida El Pardoda Portugaliya qirolichasi Mariya I va Ispaniya qiroli Karl III oʻrtasida imzolangan shartnoma. Shartnomaning maqsadi, Tordesillalar va undan keyingi shartnomalar shartlariga rioya qilmaslik natijasida yuzaga kelgan uzoq muddatli hududiy nizolarni, hal qilish edi. Shartnomadan oldin darhol Sharqiy missiyalar hududida, zamonaviy Urugvay va qisman Paragvay hududida mojarolar, shuningdek, 1761-1763-yillardagi va 1776-1777-yillardagi Ispaniya-Portugal urushlari sodir boʻldi.
Bitimning asosiy obʻekti Tordesilla shartnomasini buzgan holda, portugal banderantlari tomonidan tortib olingan yerlarni, Janubiy Amerika qaʼrida birlashtirish edi. Yangi shartnoma, avvalgi shartnomalarda qoʻllanilgan uti possidetis tamoyili asosida qurilgan. Natijada, Portugaliya hukmronligi zamonaviy Braziliya hududigacha kengaydi, portugallar esa Afrika mulklaridan voz kechishga majbur boʻlishdi — tovon sifatida Mariya I Karl III ga Annobon va Fernando Po orollarini (zamonaviy Bioko), shuningdek, Niger va Ogowe daryolari orasidagi Gvineya qirgʻoqlarini berdi.
Adabiyotlar[tahrir | manbasini tahrirlash]
- Muso, Bernard; Ispaniyaning Janubiy Amerikadagi qudrati, 1730-1806-yillar; (Kornel universiteti kutubxonasi, 2010 (ed);
- Marley, Devid; Amerika urushlari: Gʻarbiy yarim shardagi qurolli toʻqnashuvlar xronologiyasi; (ABC-Clio, 2008-yil nashri.);

