va mashgʻulotlarini reja asosida oʻtkazilishini tashkil qilish uslubiy yordam koʻrsatish;
- Yuqori tashkilotlar va direktoratdan boʻlimga kiruvchi hujjatlarni alohida daftarda roʻyxatini yuritish va ijrosini ta’minlash;
- Boʻlim faoliyatiga taalluqli buyruq va farmoyishlar loyihalarini tayyorlash, kelishuv imzolarini olish hamda boʻlim boshligʻiga taqdim etish;
- Filialda Davlat dasturlarini tuzilishi, tasdiqlanishi, tegishli mas’ullarga yetkazilishi va ijrosini ta’minlash;
- Ma’naviyat soatlari
...
nalarini tashkil etish va jihozlashda uslubiy yordam koʻrsatish;
- Kafedralarning ma’naviy-ma’rifiy ishlar boʻyicha mas’ullarning bilimlarini oshirish va tadbirlar rejalarini tuzishda uslubiy yordam berish;
- Talabalar turar joylarida yashayotgan yoshlarning boʻsh vaqtlarini mazmunli oʻtkazish maqsadida turli ma’naviy-madaniy tadbirlarni tashkil etish;
- Boʻlim arxivi va kartotekasini yuritish.
- Filial ichki tartib qoidalari, odob-axloq qoidalari va kiyinish madaniyati talablariga rioya qilish.

